export default (function(a,b,c,d,e,f,g,h){return {data:{uM3ZkJSyqA:{data:{id:1215,attributes:{imdbId:"tt0120706",poster:"https:\u002F\u002Fm.media-amazon.com\u002Fimages\u002FM\u002FMV5BZjk5OGYxYjAtY2JjNy00YjY5LWFlYWEtMzIxNzc1NzZlMzg2XkEyXkFqcGdeQXVyNDIzMzcwNjc@._V1_SX300.jpg",type:"movie",ratings:[{Source:"Internet Movie Database",Value:"7.3\u002F10"},{Source:"Rotten Tomatoes",Value:"82%"},{Source:"Metacritic",Value:"81\u002F100"}],item_lang:{data:{id:1878,attributes:{title:c,plot:"The real-life story of Dublin folk hero and criminal Martin Cahill, who pulled off two daring robberies in Ireland with his team, but attracted unwanted attention from the police, the I.R.A., the U.V.F., and members of his own team.",slug:"the-general"}}},books:{data:[{id:6729,attributes:{title:c,description:e,thumbnail:f,authors:[a],firstBook:true,published:g,publisher:d,subtitle:h}},{id:6730,attributes:{title:c,description:e,thumbnail:f,authors:[a],firstBook:b,published:g,publisher:d,subtitle:h}},{id:6731,attributes:{title:"Gangland",description:"Number 1 Bestseller Paul Williams is Ireland's No. 1 award-winning crime reporter, famed for exposing the ruthless gangsters behind Irish crime. In Gangland! he investigates who is pulling the strings behind the scenes - the families that form the Irish mafia - and examines the way in which their net has spread across Ireland and beyond. Compelling, chilling and unput-downable, Gangland gives the inside story on a dark and sinister world.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=S2SNAwAAQBAJ&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api",authors:[a],firstBook:b,published:"2012-10-04",publisher:d,subtitle:"The Shocking Exposé of the Criminal Underworld"}},{id:6732,attributes:{title:"The Monk",description:"On the streets of the tough Dublin inner-city neighbourhood where he grew up, Gerry Hutch was perceived as an ordinary decent criminal, a quintessential Robin Hood figure who fought the law - and won. To the rest of the world he was an elusive criminal godfather called the Monk: an enigmatic criminal mastermind and the hunted leader of one side in the deadliest gangland feud in Irish criminal history.The latest book from Ireland's leading crime writer Paul Williams reveals the inside story of Hutch's war with former allies the Kinahan cartel, and how the once untouchable crime boss became a fugitive on the run from the law and the mob - with a e1 million bounty on his head.The Monk is an enthralling account of the rise and fall of a modern-day gangster, charting the violent journey of an impoverished kid from the ghetto to the top tier of gangland - until it all went wrong.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=ez8mzgEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api",authors:[a],firstBook:b,published:"2021-07-01",publisher:"Atlantic Books (UK)",subtitle:"The Life and Crimes of Ireland's Most Enigmatic Gang Boss"}},{id:6733,attributes:{title:"Evil Empire",description:"The best-selling author of Gangland recounts the true story of Irish godfather John Gilligan, leader of a vast drug empire and a leading figure in the Irish underworld, the assassination of Irish investigative journalist Veronica Guerin, and the behind-the-scenes efforts of law enforcement to bring Gilligan and his cronies to justice.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=m5zmAgAAQBAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api",authors:[a],firstBook:b,published:"2003-12-11",publisher:"Macmillan",subtitle:"The Irish Mob and the Assassination of Journalist Veronica Guerin"}}]}}},meta:{}}},prerenderedAt:1680940977325}}("Paul Williams",null,"The General","The O'Brien Press","The extraordinary life and crimes of Martin Cahill, gangster, criminal mastermind, MOST WANTED MAN In a twenty-year career marked by obsessive secrecy, brutality and meticulous planning, Cahill netted over £40 million. He was untouchable - until a bullet from an IRA hitman ended it all. The General tells the inside story of The Beit robbery - one of the world's biggest art heists The attempted assassination of a top forensic scientist The O'Connor Jewellers robbery, netting £3m The tyre-slashing and intimidation The crucifixion of a suspected 'grass' The millions still missing The book reveals Cahill's bizarre personality and the activities of the Tango Squad, the special police unit which targetted him with tactics used on the infamous Kray Gang. Now a major film from John Boorman starring Brendan Gleeson and John Voight.","https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=UlqNAwAAQBAJ&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api","2013-01-08","Godfather of Crime"))